import React from "react";

//<BackstagePage />
//<ControlsPage />
const MainPage = () =>{
  return(
    <div className="MainPage"> 
      <div className="Column1">
        <VideoPage />

      </div>

      <div className = "Column2">

        <PreviewPage /> 
      </div>
    </div>
  );
};
export default MainPage;
